import { productConstants } from "../actions/constants";






export default (state, action) => {
    switch (action.type) {
        case productConstants.GET_ALL_INITIAL_DATA_SUCCESS:
            state = {
                ...state,
                products: action.payload.products
            }
            break;
    }
    return state;
}
